import React from 'react';

import Button from '../Button/Button'

import classes from './ProfilePageHeader.module.css'

const ProfilePageHeader = (props) => {
    let firstName = "Bob";
    let lastName = "Bobinsky";

    return (
        <div className={classes.profileHeader}>
            <div className={classes.background} />
            <div className={classes.bottomPart} />

            <div className={classes.mainContent}>
                <div className={classes.profileInfo}>
                    <div className={classes.avatarContainer}>
                        <img 
                            src={props.profileImage || "/default_avatar.png"} 
                            alt="avatar" 
                            className={classes.avatar}
                        />
                    </div>
                    <div className={classes.nameContainer}>
                        <h2 className={classes.name}>{firstName + " " + lastName}</h2>
                    </div>
                </div>

                <div className={classes.buttonsWrapper}>
                    <form action="/friends/requests" method='post'>
                        <Button>Добавить в друзья</Button>
                    </form>
                    <Button white="true">Поделиться</Button>
                </div>
            </div>
        </div>
    );
};

export default ProfilePageHeader;
